pragma solidity 0.4.24;

import './BaseOEApps.sol';

import '@1hive/apps-token-request/contracts/TokenRequest.sol';
import '@1hive/apps-redemptions/contracts/Redemptions.sol';
import '@1hive/delay-app/contracts/Delay.sol';

contract BiaTemplate is BaseOEApps {
    string private constant ERROR_MISSING_MEMBERS =
        'OPEN_ENTERPRISE_MISSING_MEMBERS';
    string private constant ERROR_BAD_VOTE_SETTINGS =
        'OPEN_ENTERPRISE_BAD_VOTE_SETTINGS';
    string private constant ERROR_BAD_DOT_VOTE_SETTINGS =
        'OPEN_ENTERPRISE_BAD_DOT_VOTE_SETTINGS';
    string private constant ERROR_BAD_MEMBERS_STAKES_LEN =
        'OPEN_ENTERPRISE_BAD_MEMBER_STAKES_LEN';

    uint64 private constant DEFAULT_PERIOD = uint64(30 days);
    uint64 private constant DELAY_PERIOD = uint64(1 days);
    uint8 private constant TOKEN_DECIMALS = uint8(18);
    uint256 private constant UNLIMITED_TOKENS = uint256(0);
    uint256 private constant ONE_TOKEN = uint256(1e18);
    enum Op {
        NONE,
        EQ,
        NEQ,
        GT,
        LT,
        GTE,
        LTE,
        RET,
        NOT,
        AND,
        OR,
        XOR,
        IF_ELSE
    }
    // bytes32 private constant REDEMPTIONS_APP_ID = apmNamehash('redemptions');
    bytes32 private constant REDEMPTIONS_APP_ID =
        0x743bd419d5c9061290b181b19e114f36e9cc9ddb42b4e54fc811edb22eb85e9d;
    // bytes32 private constant DELAY_APP_ID = apmNamehash('delay');
    bytes32 private constant DELAY_APP_ID =
        0x1c2b93ad1c4d4302f0169c8f596ce518e4a3324b1fed90c2d80a549a072bcd4e;
    // bytes32 private constant TOKEN_REQUEST_APP_ID = apmNamehash('token-request');
    bytes32 private constant TOKEN_REQUEST_APP_ID =
        0x35202e36ef42162f9847025dfc040c60bfa5d7c5c373cb28e30849e1db16ba77;
    uint8 constant ORACLE_PARAM_ID = 203;
    address constant ANY_ENTITY = address(-1);

    string private constant ERROR_EMPTY_HOLDERS = 'DANDELION_EMPTY_HOLDERS';
    string private constant ERROR_BAD_HOLDERS_STAKES_LEN =
        'DANDELION_BAD_HOLDERS_STAKES_LEN';
    string private constant ERROR_MISSING_DAO_CONTRACT =
        'DANDELION_MISSING_DAO_CONTRACT';
    string private constant ERROR_MISSING_FINANCE_CONTRACT =
        'DANDELION_MISSING_FINANCE_CONTRACT';
    string private constant ERROR_MISSING_TOKEN_MANAGER_CONTRACT =
        'DANDELION_MISSING_TOKEN_MANAGER_CONTRACT';
    string private constant ERROR_MISSING_VAULT_CONTRACT =
        'DANDELION_MISSING_VAULT_CONTRACT';
    string private constant ERROR_MISSING_TOKEN_CONTRACT =
        'DANDELION_MISSING_TOKEN_CONTRACT';

    struct DeployedContracts {
        address dao;
        address token;
        address finance;
        address tokenManager;
        address agentOrVault;
        bool agentAsVault;
    }

    mapping(address => DeployedContracts) internal deployedContracts;

    struct InstalledAppStruct {
        // AddressBook addressBook;
        Allocations allocations;
        Finance finance;
        // Projects projects;
        Rewards rewards;
        Agent agent;
        Vault vault;
        Redemptions redemptions;
        TokenRequest tokenRequest;
        Delay delay;
        TokenManager tokenManager1;
        TokenManager tokenManager2;
    }

    /**
     * @dev Constructor for Open Enterprise Apps DAO
     * @param _deployedSetupContracts Array of [DaoFactory, ENS, MiniMeTokenFactory, AragonID, StandardBounties]
     *       required pre-deployed contracts to set up the organization
     */
    constructor(address[4] _deployedSetupContracts)
        public
        BaseOEApps(_deployedSetupContracts)
    {}

    /**
     * @dev Create a new MiniMe token and deploy a Open Enterprise DAO.
     * @param _id String with the name for org, will assign `[id].aragonid.eth`
     */
    function newTokensAndInstance(
        string _id,
        string _name1,
        string _symbol1,
        string _name2,
        string _symbol2,
        uint64[6] _votingSettings,
        bool[2] _votingBools
    ) external {
        (MiniMeToken token1, MiniMeToken token2) = newTokens(
            _name1,
            _symbol1,
            _name2,
            _symbol2
        );
        _newInstance(_id, _votingSettings, _votingBools, token1, token2);
    }

    /**
     * @dev Install and configure TokenManager apps for previously created tokens
     *       related to the tokens settings
     */
    function newTokenManagers(
        address[] _members1,
        uint256[] _stakes1,
        address[] _members2,
        uint256[] _stakes2
    ) public {
        _validateTokenSettings(_members1, _stakes1);
        _validateTokenSettings(_members2, _stakes2);

        (ACL acl, Kernel dao, Agent agent, Vault vault) = _popBaseCache(
            msg.sender
        );
        (MiniMeToken token1, MiniMeToken token2) = _popTokensCache(msg.sender);
        // Token 1 setup
        TokenManager tokenManager1 = _installTokenManagerApp(
            dao,
            token1,
            true, // it always needs to be transferable
            UNLIMITED_TOKENS
        );

        TokenManager tokenManager2 = _installTokenManagerApp(
            dao,
            token2,
            true,
            UNLIMITED_TOKENS
        );

        _mintTokens(acl, tokenManager1, _members1, _stakes1);
        _mintTokens(acl, tokenManager2, _members2, _stakes2);
        _cacheBase(acl, dao, agent, vault, msg.sender);
        _cacheTokens(token1, token2, msg.sender);
        _cacheTokenManagers(tokenManager1, tokenManager2, msg.sender);
    }

    function finalizeDao(
        address[] memory _redemptionsRedeemableTokens,
        address[] memory _tokenRequestAcceptedDepositTokens,
        uint64[3] _appSettings
    ) public {
        (ACL acl, Kernel dao, Agent agent, Vault vault) = _popBaseCache(
            msg.sender
        );
        (MiniMeToken token1, MiniMeToken token2) = _popTokensCache(msg.sender);
        (
            TokenManager tokenManager1,
            TokenManager tokenManager2
        ) = _popTokenManagersCache(msg.sender);
        InstalledAppStruct memory installedAppStruct;
        installedAppStruct.tokenManager1 = tokenManager1;
        installedAppStruct.tokenManager2 = tokenManager2;
        installedAppStruct.agent = agent;
        installedAppStruct.vault = vault;
        // installedAppStruct.addressBook = _installAddressBookApp(dao);
        installedAppStruct.allocations = _installAllocationsApp(
            dao,
            token1,
            _appSettings[0]
        );
        installedAppStruct.finance = _installFinanceApp(
            dao,
            vault,
            _appSettings[1]
        );

        // installedAppStruct.projects = _installProjectsApp(dao, agentOrVault);
        installedAppStruct.rewards = _installRewardsApp(dao, vault);

        installedAppStruct.redemptions = _installRedemptionsApp(
            dao,
            _redemptionsRedeemableTokens,
            agent,
            tokenManager2
        );
        installedAppStruct.tokenRequest = _installTokenRequestApp(
            dao,
            _tokenRequestAcceptedDepositTokens,
            agent,
            tokenManager2
        );

        installedAppStruct.delay = _installDelaysApp(dao, _appSettings[2]);
        _cacheTokenManagers(tokenManager1, tokenManager2, msg.sender);
        _cacheTokens(token1, token2, msg.sender);
        _setupPermissions(acl, dao, installedAppStruct);
    }

    /**
     * @dev Create a new MiniMe token and cache it for the user
     * @param _name1 String with the name for the primary token used by share holders in the organization
     * @param _name2 String with the name for the reputation token used in the organization
     * @param _symbol1 String with the symbol for the primary token used by share holders in the organization
     * @param _symbol2 String with the symbol for the reputation token used in the organization
     */

    function newTokens(
        string _name1,
        string _symbol1,
        string _name2,
        string _symbol2
    ) public returns (MiniMeToken, MiniMeToken) {
        MiniMeToken token1 = _createToken(_name1, _symbol1, TOKEN_DECIMALS);
        // MiniMeToken token2 = MiniMeToken(0);
        // if (keccak256(abi.encodePacked(_symbol2)) != keccak256(abi.encodePacked(""))) {
        MiniMeToken token2 = _createToken(_name2, _symbol2, TOKEN_DECIMALS);
        // }
        _cacheTokens(token1, token2, msg.sender);

        return (token1, token2);
    }

    /**
     * @dev Deploy a Open Enterprise DAO using a previously cached MiniMe token
     * @param _id String with the name for org, will assign `[id].aragonid.eth`
     * @param _votingBools Array of 2 booleans to select reference for apps:
     *                     [DotVotingToken, VotingToken] true will select token2 as controller
     */
    function _newInstance(
        string _id,
        uint64[6] memory _votingSettings,
        bool[2] memory _votingBools,
        MiniMeToken _token1,
        MiniMeToken _token2
    ) internal {
        _validateId(_id);
        _validateVotingSettings(_votingSettings);

        (Kernel dao, ACL acl) = _createDAO();
        Vault vault = _installVaultApp(dao);
        Agent agent = _installDefaultAgentApp(dao);

        DotVoting dotVoting = _installDotVotingApp(
            dao,
            _votingBools[0] ? _token2 : _token1,
            _votingSettings[0],
            _votingSettings[1],
            _votingSettings[2]
        );
        Voting voting = _installVotingApp(
            dao,
            _votingBools[1] ? _token2 : _token1,
            _votingSettings[3],
            _votingSettings[4],
            _votingSettings[5]
        );

        _createAgentPermissions(acl, agent, voting, voting);

        _cacheVotingApps(
            dotVoting,
            voting,
            _votingBools[0],
            _votingBools[1],
            msg.sender
        );
        _cacheBase(acl, dao, agent, vault, msg.sender);
        _registerID(_id, dao);
    }

    function _setupPermissions(
        ACL _acl,
        Kernel _dao,
        InstalledAppStruct _installedAppStruct
    ) internal {
        _setupTokenPermissions(_acl, _dao, _installedAppStruct);
        //
        (DotVoting dotVoting, Voting voting, , ) = _popVotingAppsCache(
            msg.sender
        );
        (MiniMeToken token1, ) = _popTokensCache(msg.sender);

        // _createAddressBookPermissions(_acl, _installedAppStruct.addressBook, voting, voting);
        _createAllocationsPermissions(
            _acl,
            _installedAppStruct.allocations,
            dotVoting,
            voting,
            voting
        );
        _createEvmScriptsRegistryPermissions(_acl, voting, voting);
        _createFinancePermissions(
            _acl,
            _installedAppStruct.finance,
            voting,
            voting
        );
        _createFinanceCreatePaymentsPermission(
            _acl,
            _installedAppStruct.finance,
            voting,
            voting
        );
        // _createProjectsPermissions(_acl, _installedAppStruct.projects, dotVoting, voting, voting);
        _createRewardsPermissions(
            _acl,
            _installedAppStruct.rewards,
            voting,
            voting
        );

        _createVaultPermissions(
            _acl,
            _installedAppStruct.vault,
            _installedAppStruct.finance,
            address(this)
        );
        _grantVaultPermissions(
            _acl,
            _installedAppStruct.vault,
            _installedAppStruct.allocations,
            _installedAppStruct.rewards
        );

        _createRedemptionsPermissions(
            _acl,
            _installedAppStruct.redemptions,
            voting,
            voting,
            _installedAppStruct.tokenManager2
        );
        // grand some to agent app
        _acl.createPermission(
            _installedAppStruct.redemptions,
            _installedAppStruct.agent,
            _installedAppStruct.agent.TRANSFER_ROLE(),
            voting
        );

        _createTokenRequestPermissions(
            _acl,
            _installedAppStruct.tokenRequest,
            voting,
            voting
        );

        _createDelayPermissions(
            _acl,
            _installedAppStruct.delay,
            voting,
            voting,
            _installedAppStruct.tokenManager2
        );

        _transferPermissionFromTemplate(
            _acl,
            _installedAppStruct.vault,
            _installedAppStruct.vault.TRANSFER_ROLE(),
            voting
        );

        _transferRootPermissionsFromTemplateAndFinalizeDAO(_dao, voting);
    }

    function _setupTokenPermissions(
        ACL _acl,
        Kernel _dao,
        InstalledAppStruct _installedAppStruct
    ) internal {
        (
            DotVoting dotVoting,
            Voting voting,
            bool secondaryDot,
            bool secondaryVoting
        ) = _popVotingAppsCache(msg.sender);
        // (TokenManager tokenManager1, TokenManager tokenManager2) = _popTokenManagersCache(msg.sender);

        _createTokenManagerPermissions(
            _acl,
            _installedAppStruct.tokenManager1,
            voting,
            voting
        );
        _createTokenManagerPermissions(
            _acl,
            _installedAppStruct.tokenManager2,
            voting,
            address(this)
        );
        _grantTokenManagerPermissions(
            _acl,
            _installedAppStruct.tokenRequest,
            _installedAppStruct.redemptions,
            _installedAppStruct.tokenManager2,
            voting
        );

        _createDotVotingPermissions(
            _acl,
            dotVoting,
            secondaryDot
                ? _installedAppStruct.tokenManager2
                : _installedAppStruct.tokenManager1,
            voting
        );
        _createVotingPermissions(
            _acl,
            voting,
            voting,
            secondaryVoting
                ? _installedAppStruct.tokenManager2
                : _installedAppStruct.tokenManager1,
            voting
        );
        _cacheVotingApps(
            dotVoting,
            voting,
            secondaryDot,
            secondaryVoting,
            msg.sender
        );
    }

    function _grantTokenManagerPermissions(
        ACL _acl,
        TokenRequest tokenRequest,
        Redemptions redemptions,
        TokenManager tokenManager2,
        address _manager
    ) internal {
        _acl.grantPermission(
            tokenRequest,
            tokenManager2,
            tokenManager2.MINT_ROLE()
        );
        _acl.grantPermission(
            redemptions,
            tokenManager2,
            tokenManager2.BURN_ROLE()
        );
        _acl.setPermissionManager(
            _manager,
            tokenManager2,
            tokenManager2.MINT_ROLE()
        );
        _acl.setPermissionManager(
            _manager,
            tokenManager2,
            tokenManager2.BURN_ROLE()
        );
    }

    /* TOKEN REQUEST */

    function _installTokenRequestApp(
        Kernel _dao,
        address[] memory _tokenRequestAcceptedDepositTokens,
        Agent agent,
        TokenManager tokenManager2
    ) internal returns (TokenRequest) {
        TokenRequest tokenRequest = TokenRequest(
            _registerApp(_dao, TOKEN_REQUEST_APP_ID)
        );
        tokenRequest.initialize(
            tokenManager2,
            agent,
            _tokenRequestAcceptedDepositTokens
        );
        return tokenRequest;
    }

    function _installRedemptionsApp(
        Kernel _dao,
        address[] memory _redemptionsRedeemableTokens,
        Agent agent,
        TokenManager tokenManager2
    ) internal returns (Redemptions) {
        Redemptions redemptions = Redemptions(
            _registerApp(_dao, REDEMPTIONS_APP_ID)
        );
        redemptions.initialize(
            agent,
            tokenManager2,
            _redemptionsRedeemableTokens
        );
        return redemptions;
    }

    function _installDelaysApp(Kernel _dao, uint64 _periodDelay)
        internal
        returns (Delay)
    {
        Delay delay = Delay(_registerApp(_dao, DELAY_APP_ID));
        delay.initialize(_periodDelay);
        return delay;
    }

    function _registerApp(Kernel _dao, bytes32 _appId)
        private
        returns (address)
    {
        address proxy = _dao.newAppInstance(
            _appId,
            _latestVersionAppBase(_appId)
        );
        emit InstalledApp(proxy, _appId);

        return proxy;
    }

    // ORACLE FNS
    // function _setOracle2(ACL _acl, address _who, address _where, bytes32 _what, address _oracle) private {
    //     uint256[] memory params = new uint256[](1);
    //     params[0] = _paramsTo256(ORACLE_PARAM_ID, uint8(Op.EQ), uint240(_oracle));

    //     _acl.grantPermissionP(_who, _where, _what, params);
    // }
    // function _paramsTo256(uint8 _id,uint8 _op, uint240 _value) private returns (uint256) {
    //     return (uint256(_id) << 248) + (uint256(_op) << 240) + _value;
    // }

    function _createRedemptionsPermissions(
        ACL _acl,
        Redemptions _redemptions,
        address _grantee,
        address _manager,
        TokenManager _tokenManager
    ) internal {
        _acl.createPermission(
            _grantee,
            _redemptions,
            _redemptions.ADD_TOKEN_ROLE(),
            address(this)
        );
        _acl.grantPermission(
            _tokenManager,
            _redemptions,
            _redemptions.ADD_TOKEN_ROLE()
        );

        _acl.createPermission(
            _grantee,
            _redemptions,
            _redemptions.REMOVE_TOKEN_ROLE(),
            _manager
        );
        _acl.createPermission(
            ANY_ENTITY,
            _redemptions,
            _redemptions.REDEEM_ROLE(),
            address(this)
        );

        _acl.setPermissionManager(
            _manager,
            _redemptions,
            _redemptions.REDEEM_ROLE()
        );
        _acl.setPermissionManager(
            _manager,
            _redemptions,
            _redemptions.ADD_TOKEN_ROLE()
        );
    }

    function _createTokenRequestPermissions(
        ACL _acl,
        TokenRequest _tokenRequest,
        address _grantee,
        address _manager
    ) internal {
        _acl.createPermission(
            _grantee,
            _tokenRequest,
            _tokenRequest.SET_TOKEN_MANAGER_ROLE(),
            _manager
        );
        _acl.createPermission(
            _grantee,
            _tokenRequest,
            _tokenRequest.SET_VAULT_ROLE(),
            _manager
        );
        _acl.createPermission(
            _grantee,
            _tokenRequest,
            _tokenRequest.MODIFY_TOKENS_ROLE(),
            _manager
        );
        _acl.createPermission(
            _grantee,
            _tokenRequest,
            _tokenRequest.FINALISE_TOKEN_REQUEST_ROLE(),
            _manager
        );
    }

    function _createDelayPermissions(
        ACL _acl,
        Delay _delay,
        address _grantee,
        address _manager,
        TokenManager _tokenManager // DotVoting _dotVoting, // Voting _voting, // MiniMeToken _token
    ) internal {
        _acl.createPermission(
            _grantee,
            _delay,
            _delay.DELAY_EXECUTION_ROLE(),
            _manager
        );
        _acl.createPermission(
            _grantee,
            _delay,
            _delay.SET_DELAY_ROLE(),
            _manager
        );
        _acl.createPermission(
            _tokenManager,
            _delay,
            _delay.PAUSE_EXECUTION_ROLE(),
            _manager
        );
        _acl.createPermission(
            _grantee,
            _delay,
            _delay.RESUME_EXECUTION_ROLE(),
            _manager
        );
        _acl.createPermission(
            _tokenManager,
            _delay,
            _delay.CANCEL_EXECUTION_ROLE(),
            _manager
        );
    }

    function _validateVotingSettings(uint64[6] memory _votingSettings)
        private
        pure
    {
        require(_votingSettings.length == 6, ERROR_BAD_VOTE_SETTINGS);
    }

    function _validateTokenSettings(
        address[] memory _members,
        uint256[] memory _stakes
    ) private pure {
        require(_members.length > 0, ERROR_MISSING_MEMBERS);
        require(
            _members.length == _stakes.length,
            ERROR_BAD_MEMBERS_STAKES_LEN
        );
    }
}

